import { useSelector } from 'react-redux';
import { API, SuspenseGet, wrapPromise } from 'utils/api';

export const fetchUserProfile = () => {
	const { userId, jwt } = useSelector((state) => state.UserDataReducer);
	return SuspenseGet({
		url: `web/profile/${userId}`,
		headers: {
			'x-access-token': jwt,
		},
	});
};

const fetchUserResume = ({ userId, jwt }) =>
	SuspenseGet({
		url: `web/profile/${userId}/resume`,
		headers: {
			'x-access-token': jwt,
		},
	});

const fetchUserSpecialty = ({ userId, jwt }) =>
	SuspenseGet({
		url: `/web/profile/${userId}/specialty`,
		headers: {
			'x-access-token': jwt,
		},
	});

export const fetchProfileDataLevel3 = ({ userId, jwt }) => ({
	baseProfile: fetchUserResume({ userId, jwt }),
	resumeProfile: fetchUserSpecialty({ userId, jwt }),
});
